import axios from 'axios'
import { instance } from '../index'
import { type } from 'os'

export const getHistory = async (offset: number) => {
  try {
    const response = await instance.get('administrators/churchs/history/', {
      params: { offset },
    })
    return response.data
  } catch (error) {
    console.error(error)
  }
}
